  const {id} = useParams();
  const [allData, setAllData] = useState([])


  const fetchAllData = async (id) => {
    const res = await fetch('http://localhost:5000/organisation/getbyid/' + id)

    console.log(res.status)

    const data = await res.json();
    console.log(data)
    setAllData(data)
  }

